INSERT INTO `hospitals` (`id`, `name`, `address`, `email`, `website`, `phone`, `description`, `premium`, `created_at`, `updated_at`, `published_at`, `created_by_id`, `updated_by_id`) VALUES
(1, 'Apollo Hospitals', 'Sarita Vihar,Delhi Mathura Road,New Delhi,Delhi,110076 (India)', 'apollohospitals@gmail.com', 'https://www.apollohospitals.com/', 2147483647, 'Apollo Hospitals has emerged as Asia’s foremost integrated healthcare services provider and has a robust presence across the healthcare ecosystem, including Hospitals, Pharmacies, Primary Care & Diagnostic Clinics and several retail health models. The Group also has Telemedicine facilities across several countries, Health Insurance Services, Global Projects Consultancy, Medical Colleges, Medvarsity for E-Learning, Colleges of Nursing and Hospital Management and a Research Foundation. In addition, ‘ASK Apollo’ – an online consultation portal and Apollo Home Health provide the care continuum.', 1, '2024-04-28 17:02:05.011000', '2024-04-28 17:02:07.071000', '2024-04-28 17:02:07.067000', 1, 1),
(2, 'Kauvery Hospital', '81, TTK Road Junction, CIT Colony, Alwarpet, Chennai, Tamil Nadu 600018, India\n', 'Kauveryhospital@gmail.com', 'https://www.kauveryhospital.com/', 2147483647, 'Kauvery hospital launched its first hospital more than two decades ago, the founders of Kauvery Hospital have been determined on creating world class healthcare facilities that shall be affordable. The founding doctors set off on this dream in 1999 with a 30-bed hospital in Trichy, with single-minded focus on offering ‘best-in-class healthcare, with a personal touch.’ This was a very new concept in a tier 2 city like Trichy which lacked a tertiary care hospital at the time. Today, Kauvery is a multi-specialty hospital chain with 2250+ beds in six locations including Trichy, Chennai, Salem, Hosur, Tirunelveli and Bengaluru. With twelve hospitals and a workforce of over 8000+ Kauvery’s mission is to provide exemplary secondary and tertiary care.', 1, '2024-04-28 17:08:10.818000', '2024-04-28 18:01:57.751000', '2024-04-28 17:08:21.488000', 1, 1),
(3, 'stanley hospital', 'SUPER SPECIALITY BLOCK, MC Rd, Old Washermanpet, Chennai, Tamil Nadu 600001', 'stanleyhospital@gmail.com', 'https://g.co/kgs/jGJn6qT', 2147483647, 'tanley Medical College (SMC) is a government medical college with hospitals, located in Chennai (Madras) in the state of Tamil Nadu, India. Though the original hospital is more than 200 years old, the medical college was formally established on July 2, 1938. Stanley Medical College is ranked 11th in the India Today & Nielson 2013 survey. With regard to the recent developments in our institutions, Stanley medical college is one of the medical colleges in Tamil Nadu to receive 250 MBBS seats, sanctioned in the year 2013-14. This institution is savored as a heritage and will continue to impart its finest knowledge to the community in the years to come.', 1, '2024-04-28 21:54:10.182000', '2024-04-28 21:54:15.951000', '2024-04-28 21:54:15.947000', 1, 1),
(4, 'Meenakshi Hospital', 'New No 70, Old No 149, Luz Church Road, Mylapore, Chennai - 600004', 'MeenakshiHospital@gmail.com', 'https://www.practo.com/chennai/hospital/chennai-meenakshi-multi-speciality-hospital-mylapore-1/doctors', 2147483647, 'Chennai Meenakshi Multispeciality Hospital Limited formerly known as Devaki Hospital is a 100-bedded hospital located in the heart of city headed by its CEO Dr.V.Krishnamurthy, an eminent Rheumatologist. He is ably assisted by a team of dedicated specialists with commitment, empathy, professional skill, expeditious response and quality care at affordable cost.', 1, '2024-04-28 21:59:03.874000', '2024-04-28 21:59:06.771000', '2024-04-28 21:59:06.759000', 1, 1);

